import React from "react";
import "./App.css";
import NavBar from "./components/NavBar";
import Book from "./components/Book";

function App() {
  return (
    <div className="dashboard-container">
      <NavBar />
      <div className="main-content">
        <Book />
      </div>
    </div>
  );
}

export default App;
